import React from 'react';
import logoIndex from './assets/logo.png';


function App() {

  return (
    <div>
      <div className="Navbar">
        <li>
          <img src={logoIndex} className= "logoIndex"/>
        </li>
        <ul class="nav">
          <li class="nav-item">
            <a class="nav-link active" aria-current="page" href="#">Inicio</a>
          </li>
          <li class="nav-item">
            <a class="nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Acerca de</a>
          </li>
          <li class="nav-item">
            <a class="nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Contacto</a>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default App;
